import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Unclustered from "./pages/Unclustered";
import { UnclusteredStates } from "./pages/Unclustered-states/Unclustered-states";
import UnclusteredZip from "./pages/Unclustered-zip";

export default function Routes() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route component={UnclusteredZip} path="/maps/cluster" />
        <Route component={UnclusteredStates} path="/maps/choropleth" />
        <Route component={Unclustered} exact path="/" />
      </Switch>
    </Router>
  );
}
